INSERT INTO `soal` VALUES   ('3','5','1','Apa itu class dalam OOP?','1','Struktur data','Kumpulan objek','Template untuk objek','Variable','Method','C','','','','','','','');
INSERT INTO `soal` VALUES ('4','5','2','Apa tujuan dari inheritance?','1','Menghapus class','Menambahkan objek','Mewarisi properti dari class lain','Menghapus method','Membuat interface','C','','','','','','','');
INSERT INTO `soal` VALUES ('5','5','3','Dalam OOP, apa itu objek?','1','Variabel dalam program','Hasil dari instance class','Tipe data primitif','Method dalam class','Function dari class','B','','','','','','','');
INSERT INTO `soal` VALUES ('6','5','4','Apa fungsi dari keyword super?','1','Membuat objek baru','Mengakses superclass','Menulis method baru','Membuat subclass','Menghapus objek','B','','','','','','','');
INSERT INTO `soal` VALUES ('7','5','5','Apa yang dimaksud dengan abstract class?','1','Class yang bisa diinstansiasi','Class yang tidak bisa diinstansiasi','Class tanpa method','Class dengan private method','Class dengan method final','B','','','','','','','');
INSERT INTO `soal` VALUES ('8','5','6','Apa fungsi dari this keyword?','1','Mengacu pada superclass','Menghapus objek','Mengacu pada objek saat ini','Mengubah objek','Mewakili instance lain','C','','','','','','','');
INSERT INTO `soal` VALUES ('9','5','7','Bagaimana cara membuat objek dari class di Java?','1','Menggunakan this','Menggunakan super','Menggunakan new','Menggunakan static','Menggunakan void','C','','','','','','','');
INSERT INTO `soal` VALUES ('10','5','8','Apa itu method overloading?','1','Mendefinisikan method dengan nama yang sama tetapi parameter berbeda','Menghapus method','Mendefinisikan method dengan nama yang sama di superclass','Mengubah tipe return dari method','Membuat dua method dengan nama berbeda','A','','','','','','','');
INSERT INTO `soal` VALUES ('11','5','9','Apa itu constructor dalam OOP?','1','Sebuah method yang dipanggil ketika objek dibuat','Method biasa','Variabel class','Interface','Tipe data','A','','','','','','','');
INSERT INTO `soal` VALUES ('12','5','10','Apa tujuan utama dari polymorphism?','1','Menyembunyikan data','Menggunakan objek dengan banyak bentuk','Meningkatkan kinerja program','Mengubah tipe data','Membuat objek baru','B','','','','','','','');
INSERT INTO `soal` VALUES ('13','5','11','Apa yang dimaksud dengan interface di Java?','1','Class tanpa atribut','Kumpulan method tanpa implementasi','Class dengan implementasi method','Tipe data primitif','Class dengan method final','B','','','','','','','');
INSERT INTO `soal` VALUES ('14','5','12','Apa perbedaan antara class dan object?','1','Class adalah instance dari object','Object adalah instance dari class','Class adalah tipe data','Object adalah method','Class tidak memerlukan constructor','B','','','','','','','');
INSERT INTO `soal` VALUES ('15','5','13','Apa tujuan dari modifier private?','1','Membuat method public','Membuat method dapat diakses dari mana saja','Membatasi akses method atau variabel','Menginisialisasi objek','Mengimplementasikan interface','C','','','','','','','');
INSERT INTO `soal` VALUES ('16','5','14','Apa yang dimaksud dengan encapsulation?','1','Menyembunyikan detail implementasi','Menggunakan objek tanpa inheritance','Membuat subclass','Menghubungkan dua class','Menghapus objek','A','','','','','','','');
INSERT INTO `soal` VALUES ('17','5','15','Apa yang terjadi jika constructor tidak didefinisikan dalam class?','1','Error saat kompilasi','Java akan membuat constructor default','Program tidak dapat dijalankan','Semua method akan gagal','Program akan berhenti','B','','','','','','','');
INSERT INTO `soal` VALUES ('18','5','16','Apa itu final keyword dalam Java?','1','Digunakan untuk inheritance','Digunakan untuk method overriding','Digunakan untuk mencegah perubahan nilai variabel atau class','Digunakan untuk membuat constructor','Digunakan untuk inisialisasi objek','C','','','','','','','');
INSERT INTO `soal` VALUES ('19','5','17','Kapan static keyword digunakan?','1','Untuk membuat method dapat diwariskan','Untuk mengakses variabel instance','Untuk membuat method atau variabel milik class, bukan objek','Untuk menghapus objek','Untuk menginisialisasi objek','C','','','','','','','');
INSERT INTO `soal` VALUES ('20','5','18','Apa yang dimaksud dengan method overriding?','1','Method dengan nama yang sama tetapi di class berbeda','Method yang hanya bisa digunakan di subclass','Method yang mengubah tipe return','Method yang menggantikan method superclass di subclass','Method yang hanya bisa dipanggil sekali','D','','','','','','','');
INSERT INTO `soal` VALUES ('21','5','19','Apa yang dimaksud dengan inner class?','1','Class yang didefinisikan di luar class lain','Class yang didefinisikan di dalam method','Class yang didefinisikan di dalam class lain','Class yang bisa diinstansiasi lebih dari sekali','Class tanpa constructor','C','','','','','','','');
INSERT INTO `soal` VALUES ('22','5','20','Apa yang dimaksud dengan constructor chaining?','1','Menghubungkan beberapa constructor dalam subclass','Memanggil constructor dari superclass dalam constructor subclass','Membuat beberapa constructor di class yang sama','Menghapus constructor yang tidak diperlukan','Mengubah nilai variabel melalui constructor','B','','','','','','','');
INSERT INTO `soal` VALUES ('23','5','21','Apa yang dimaksud dengan \"IS-A\" relationship?','1','Hubungan antara object dan method','Hubungan antara subclass dan superclass','Hubungan antara dua object yang sama','Hubungan antara variabel dan objek','Hubungan antara method dan class','B','','','','','','','');
INSERT INTO `soal` VALUES ('24','5','22','Apa fungsi dari instanceof operator di Java?','1','Mengecek tipe variabel','Membandingkan dua objek','Mengecek apakah suatu objek adalah instance dari class tertentu','Membuat instance baru dari class','Membandingkan method','C','','','','','','','');
INSERT INTO `soal` VALUES ('25','5','23','Apa itu garbage collection di Java?','1','Proses menghapus file','Proses menghapus objek yang tidak digunakan','Proses membuat objek baru','Proses menghapus variabel','Proses mengoptimalkan penggunaan memori','B','','','','','','','');
INSERT INTO `soal` VALUES ('26','5','24',' Apa peran dari protected modifier di Java?','1','Membatasi akses method ke class yang sama','Mengizinkan method diakses dari package yang sama dan subclass','Membuat method private','Menghapus method','Membatasi penggunaan interface','B','','','','','','','');
INSERT INTO `soal` VALUES ('27','5','25','Apa itu default method dalam interface di Java?','1','Method yang harus diimplementasikan oleh semua class','Method yang tidak diimplementasikan di interface','Method yang memiliki implementasi default di interface','Method yang hanya bisa dipanggil dari subclass','Method yang hanya dipanggil sekali','C','','','','','','','');
INSERT INTO `soal` VALUES ('28','5','26','Apa yang dimaksud dengan try-catch di Java?','1','Syntax untuk iterasi','Syntax untuk mengelola exception','Syntax untuk membuat method','Syntax untuk inheritance','Syntax untuk constructor','B','','','','','','','');
INSERT INTO `soal` VALUES ('29','5','27','Apa yang dimaksud dengan Exception di Java?','1','Masalah saat runtime','Error kompilasi','Tipe data primitif','Keyword untuk inheritance','Variabel tanpa nilai','A','','','','','','','');
INSERT INTO `soal` VALUES ('30','5','28','Apa itu StringBuilder di Java?','1','Class untuk memanipulasi string tanpa membuat objek baru','Tipe data primitif','Method untuk membuat string','Variabel final','Method untuk menghapus string','A','','','','','','','');
INSERT INTO `soal` VALUES ('31','5','29','Apa perbedaan antara == dan equals() dalam Java?','1','== membandingkan referensi objek, equals() membandingkan nilai objek','== untuk operator logika, equals() untuk operator aritmatika','== untuk tipe data primitif, equals() untuk objek','== untuk variabel, equals() untuk method','== untuk membandingkan string','A','','','','','','','');
INSERT INTO `soal` VALUES ('32','5','30','Apa yang dimaksud dengan method chaining?','1','Memanggil beberapa method dalam satu objek','Menghubungkan beberapa class','Menghubungkan constructor','Membuat objek dengan method berbeda','Menghapus beberapa method','A','','','','','','','');
INSERT INTO `soal` VALUES ('33','5','31','Apa tujuan dari synchronized keyword?','1','Menghapus objek','Menghentikan program','Mengelola akses ke resource yang dibagikan oleh beberapa thread','Membuat objek final','Membatasi penggunaan variabel','C','','','','','','','');
INSERT INTO `soal` VALUES ('34','5','32','Apa yang dimaksud dengan volatile keyword?','1','Digunakan untuk inheritance','Digunakan untuk method static','Digunakan untuk memberitahu compiler bahwa nilai variabel dapat diubah oleh thread lain','Digunakan untuk membuat constructor','Digunakan untuk method overloading','C','','','','','','','');
INSERT INTO `soal` VALUES ('35','5','33','Apa yang dimaksud dengan Thread di Java?','1','Sebuah method','Sebuah class','Sebuah mekanisme untuk menjalankan beberapa bagian dari program secara paralel','Sebuah variabel','Sebuah keyword','C','','','','','','','');
INSERT INTO `soal` VALUES ('36','5','34','Apa yang dimaksud dengan Lambda expression di Java?','1','Cara mendeklarasikan class','Cara mendefinisikan anonymous method','Cara mendefinisikan method static','Cara mendeklarasikan constructor','Cara mendeklarasikan objek baru','B','','','','','','','');
INSERT INTO `soal` VALUES ('37','5','35','Apa yang dimaksud dengan functional interface?','1','Interface dengan lebih dari satu method','Interface dengan variabel static','Interface dengan hanya satu abstract method','Interface dengan final method','Interface tanpa method','C','','','','','','','');
INSERT INTO `soal` VALUES ('38','5','36','Apa yang dimaksud dengan default constructor?','1','Constructor dengan parameter','Constructor tanpa parameter','Constructor yang dipanggil secara otomatis jika tidak ada constructor lain yang didefinisikan','Constructor yang dapat di-overload','Constructor yang dapat diwariskan','C','','','','','','','');
INSERT INTO `soal` VALUES ('39','5','37','Apa yang dimaksud dengan Method Reference di Java?','1','Cara merujuk ke method tanpa memanggilnya secara eksplisit','Cara mendefinisikan method baru','Cara meng-overload method','Cara untuk mewarisi method dari class lain','Cara mendefinisikan constructor','A','','','','','','','');
INSERT INTO `soal` VALUES ('40','5','38','Apa itu immutable object dalam Java?','1','Objek yang dapat diubah nilainya','Objek yang tidak dapat diubah setelah dibuat','Objek yang dapat diwariskan','Objek yang memiliki referensi ke objek lain','Objek yang bisa dipakai oleh thread lain','B','','','','','','','');
INSERT INTO `soal` VALUES ('42','5','40','Apa perbedaan antara List dan Set dalam Java?','1','List tidak mengizinkan elemen duplikat, Set mengizinkan duplikat','Set tidak mengizinkan elemen duplikat, List mengizinkan duplikat','List adalah interface, Set bukan','Set mengizinkan nilai null, List tidak','Tidak ada perbedaan','B','','','','','','','');
INSERT INTO `soal` VALUES ('43','5','41','Apa itu hashCode() method di Java?','1','Method untuk menghitung hash dari objek','Method untuk membuat objek final','Method untuk membandingkan dua objek','Method untuk mengubah nilai objek','Method untuk menambahkan objek ke list','A','','','','','','','');
INSERT INTO `soal` VALUES ('44','5','42','Apa yang dimaksud dengan Comparable interface di Java?','1','Interface untuk membandingkan objek satu sama lain','Interface untuk melakukan iterasi pada objek','Interface untuk membuat objek baru','Interface untuk menghapus objek','Interface untuk inheritance','A','','','','','','','');
INSERT INTO `soal` VALUES ('45','5','43','Apa yang dimaksud dengan Iterator di Java?','1','Class yang digunakan untuk membuat objek','Interface yang digunakan untuk melakukan iterasi pada koleksi','Method untuk menghapus objek','Method untuk membandingkan objek','Class untuk membuat koleksi','B','','','','','','','');
INSERT INTO `soal` VALUES ('46','5','44','Apa yang dimaksud dengan factory method di Java?','1','Method yang menginisialisasi objek','Method yang mengembalikan instance dari class','Method yang membuat objek singleton','Method yang dipanggil oleh constructor','Method yang digunakan untuk garbage collection','B','','','','','','','');
INSERT INTO `soal` VALUES ('47','5','45','Apa itu singleton pattern?','1','Pola desain di mana class hanya memiliki satu instance','Pola desain di mana class memiliki banyak instance','Pola desain untuk inheritance','Pola desain untuk method overloading','Pola desain untuk method overriding','A','','','','','','','');
INSERT INTO `soal` VALUES ('48','5','46','Apa yang dimaksud dengan Deep Copy dalam Java?','1','Mengkopi referensi objek saja','Mengkopi seluruh objek beserta nilai-nilai yang dipegangnya','Mengkopi method dari superclass','Mengkopi method dan constructor','Mengkopi interface','B','','','','','','','');
INSERT INTO `soal` VALUES ('49','5','47','Apa itu Shallow Copy?','1','Hanya mengkopi referensi objek, bukan nilai-nilai dalam objek','Mengkopi semua nilai dari objek','Mengkopi method dan variabel dari superclass','Mengkopi konstruktor saja','Mengkopi variabel static saja','A','','','','','','','');
INSERT INTO `soal` VALUES ('50','5','48','Apa tujuan dari finalize() method di Java?','1','Untuk menghapus objek secara manual','Untuk memberikan kesempatan terakhir sebelum garbage collection','Untuk menghentikan eksekusi program','Untuk menginisialisasi objek','Untuk menutup program','B','','','','','','','');
