INSERT INTO `soal` VALUES ('79','13','15','<p>Keseimbangan antara hak dan kewajiban warga negara yang terkandung dalam nilai-nilai Pancasila dan dijabarkan dalam UUD NRI Tahun 1945 serta peraturan perundang- undangan lainnya disebut &hellip;</p>','1','<p>Nilai Dasar</p>','<p>Nilai Praksis</p>','<p>Nilai Ideal</p>','<p>Nilai Instrumental</p>','<p>Nilai Estetika</p>','D','','','','','','','');
