INSERT INTO `soal` VALUES ('81','13','17','<p>Kita harus menyadari bahwa tidak semua pelanggaran hak dan pengingkaran kewajiban disebabkan oleh faktor dari luar. Namun, banyak yang berasal dari diri pelaku sendiri seperti&hellip;</p>','1','<p>Toleransi dengan bersikap yang tidak bertentangan dengan pendirian sendiri</p>','<p>Tingginya sikap menghargai kedudukan orang lain</p>','<p>Kesenjangan dalam berbagai aspek kehidupan baik trigatra maupun astagatra</p>','<p>Prilaku yang didasarkan atas dorongan untuk keuntungan diri sendiri tanpa memperdulikan orang lain</p>','<p>Munculnya kesadaran berbangsa dan bernegara</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('82','13','18','<p>Apabila pelanggaran hak dan pengingkaran kewajiban terlanjur terjadi kita dapat melakukan upaya refresif, yaitu pengendalian sosial yang dilakukan oleh masyarakat setelah terjadi penyimpangan. Cara refresif dilakukan dengan....</p>','1','<p>Mengarahkan individu agar mematuhi nilai-nilai yang berlaku</p>','<p>Membujuk masyarakat agar mematuhi norma-norma yang mengikat</p>','<p>Menjatuhkan sanksi hukum yang tegas jika pelaku tidak dikenal</p>','<p>Mengancam agar tidak mengulang perbuatan yang merugikan orang lain</p>','<p>Menindak untuk memberikan sanksi bagi para pelakunya</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('83','13','19','<p>Dalam penanganan pelanggaran hak dan pengingkaran kewajiban yang bersifat refresif, posisi lembaga negara sangatlah vital. Oleh karena itu, diciptakan lembaga yang berwenang untuk memeriksa, memutus, dan menyelesaikan perkara pidana dan perdata yang bertugas memberikan keterangan, pertimbangan, dan nasihat tentang hukum kepada instansi pemerintah di bawahnya. Lembaga yang dimaksud adalah&hellip;.</p>','1','<p>Lembaga Peradilan</p>','<p>Direktorat Jenderal Pajak Kementerian Keuangan</p>','<p>Tentara Nasional Indonesia</p>','<p>Komisi Pemberantasan Korupsi</p>','<p>Kepolisian Republik Indonesia</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('84','13','21','<p>Pernyataan berikut yang selaras dengan makna pasal 27 ayat (3) UUD NRI Tahun 1945 adalah....</p>','1','<p>Kewajiban warga negara untuk menjunjung hukum dan pemerintahan</p>','<p>Hak warga negara untuk mendapat perlindungan hukum</p>','<p>Hak warga negara atas pekerjaan dan penghidupan yang layak</p>','<p>Hak dan kewajiban warga negara untuk ikut serta dalam upaya pembelaan negara</p>','<p>Hak dan kewajiban warga negara untuk ikut serta dalam upaya pertahanan dan keamanan negara</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('85','13','22','<p>Nilai praktis merupakan perwujudan nilai dasar dan nilai instrumental Pancasila melalui perilaku dalam kehidupan sehari-hari. Berikut ini merupakan wujud pelaksanaan hak dan kewajiban warga negara berdasarkan nilai praksis sila ketiga Pancasila...</p>','1','<p>Melaksanakan ibadah berdasarkan agama dan kepercayaan masing-masing</p>','<p>Menghormati setiap keputusan yang dihasilkan melalui musyawarah</p>','<p>Memberikan pertolongan kepada orang lain</p>','<p>Mendahulukan kepentingan bersama di atas kepentingan pribadi dan golongan</p>','<p>Ikut serta dalam kegiatan bakti sosial</p>\r\n<p>&nbsp;</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('86','13','23','<p>Pada UU No. 23 Tahun 2004 disebutkan bahwa perlindungan hukum adalah segala upaya yang ditujukan untuk memberikan rasa aman kepada korban yang dilakukan oleh&hellip;</p>','1','<p>Badan Intelijen Negara</p>','<p>Badan Narkotika Nasional</p>','<p>Aparat Kepolisian</p>','<p>Badan SAR Nasional</p>','<p>Lembaga Ketahanan Nasional</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('87','13','24','<p>Dalam Pasal 13 UU No. 2 Tahun 2002 tentang Kepolisian Negara Republik Indonesia, dijelaskan bahwa <strong>tugas pokok </strong>Kepolisian Negara Republik Indonesia, (1) memelihara keamanan dan ketertiban masyarakat; (2) menegakkan hukum; dan (3)....</p>','1','<p>Turut serta dalam pembinaan hukum nasional</p>','<p>Memelihara ketertiban dan menjamin keamanan umum</p>','<p>Memberikan perlindungan, pengayoman, dan pelayanan kepada masyarakat</p>','<p>Membina masyarakat untuk meningkatkan partisipasi masyarakat</p>','<p>Melakukan penyelidikan dan penyidikan terhadap semua tindak pidana sesuai dengan hukum acara pidana dan peraturan perundang-undangan lainnya</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('88','13','20','<p>Komisi Pemberantasan Korupsi berkewajiban melakukan tindakan-tindakan pencegahan tindak pidana korupsi. Upaya ini dibangun dengan cara melakukan sosialisasi tentang aturan maupun dampak dari suatu tindakan korupsi. Untuk melaksanakan hal itu, KPK memiliki tugas melakukan penyelidikan, penyidikan, dan penuntutan terhadap tindak pidana korupsi yang diatur di dalam....</p>','1','<p>UU No. 30 Tahun 2002 tentang Komisi Pemberantasan Tindak Pidana Korupsi</p>','<p>UU&nbsp; No. 30 Tahun 2002 tentang Komisi Pemberantasan Korupsi</p>','<p>UU&nbsp; No. 31 Tahun 2002 tentang Komisi Pemberantasan Korupsi</p>','<p>UU&nbsp; No. 32 Tahun 2002 tentang Komisi Pemberantasan Korupsi</p>','<p>UU&nbsp; No. 33 Tahun 2002 tentang Komisi Pemberantasan Korupsi</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('89','13','25','<p>Kepolisian Negara Republik Indonesia selaku alat negara, dalam melaksanakan tugasnya selalu berpedoman pada asas legalitas. Hal tersebut sebagai aktualisasi paradigma supremasi hukum yang bertujuan untuk, (1) memperkuat kepastian hukum; (2) menciptakan keadilan dan kejujuran untuk terdakwa; (3) mengefektifkan fungsi penjeraan dalam sanksi pidana; (4) mencegah penyalahgunaan kekuasaan; dan (5) memperkuat <em>rule of law</em>. Hal tersebut diatur di dalam&hellip;</p>','1','<p>Pasal 13 UU No. 2 Tahun 2002</p>','<p>Pasal 14 UU No. 2 Tahun 2002</p>','<p>Pasal 15 UU No. 2 Tahun 2002</p>','<p>Pasal 16 UU No. 2 Tahun 2002</p>','<p>Pasal 17 UU No. 2 Tahun 2002</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('90','13','26','<p>Kejaksaan Republik Indonesia adalah lembaga pemerintahan yang melaksanakan kekuasaan negara di bidang penuntutan serta kewenangan lain berdasarkan undang-undang. Kekuasaan negara tersebut harus dilaksanakan secara merdeka, maksudnya adalah...</p>','1','<p>Kejaksaan terlepas dari pengaruh kekuasaan pemerintah dan kekuasaan lainnya dalam melaksanakan fungsi, tugas, dan kewenangannya</p>','<p>Kejaksaan bertanggung jawab atas penuntutan yang dilaksanakan secara independen demi keadilan berdasarkan hukum dan hati nurani</p>','<p>Kejaksaan dapat sepenuhnya merumuskan serta mengendalikan arah dan kebijakan penanganan perkara untuk keberhasilan penuntutan</p>','<p>Kejaksaan diberikan kewenangan untuk melakukan penyidikan terhadap kasus tindak pidana tertentu</p>','<p>Kejaksaan diberikan kewenangan untuk melakukan penyidikan terhadap kasus perdata saja</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('91','13','27','<p>Tugas dan wewenang Kejaksaan Republik Indonesia yang tercantum dalam Pasal 30 UU No. 16 Tahun 2004 di bidang perdata dan tata usaha negara adalah...</p>','1','<p>Melakukan penuntutan terhadap semua perkara pidana</p>','<p>Bertindak baik di dalam maupun di luar pengadilan untuk dan atas nama negara dan pemerintah</p>','<p>Melaksanakan penerapan hakim dan putusan pengadilan yang telah memperoleh kekuatan hukum tetap</p>','<p>Melakukan pengawasan terhadap pelaksanaan putusan pidana bersyarat, putusan pidana pengawasan, dan keputusan lepas bersyarat</p>','<p>Melakukan penyidikan terhadap tindak pidana tertentu berdasarkan undang-undang</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('92','13','28','<p>Kekuasaan kehakiman di Indonesia diatur dalam Bab IX UUD NRI Tahun 1945 dan secara khusus dalam UU No. 48 Tahun 2009 tentang kekuasaan kehakiman. Berdasarkan peraturan tersebut, lembaga yang berwenang menguji peraturan perundang-undangan di bawah undang-undang terhadap undang-undang adalah....</p>','1','<p>Mahkamah Agung</p>','<p>Mahkamah Konstitusi</p>','<p>Komisi Yudisial</p>','<p>Komisi Pemberantasan Korupsi</p>','<p>Pengadilan Militer</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('93','13','29','<p>Peranan penting yang diemban oleh komisi yudisial dalam rangka menjalankan kekuasaan kehakiman adalah....</p>','1','<p>Menguji undang-undang terhadap UUD NRI Tahun 1945</p>','<p>Menguji peraturan perundang-undangan di bawah undang-undang terhadap undang-undang</p>','<p>Memutus sengketa kewenangan lembaga negara yang kewenangannya diberikan oleh UUD NRI Tahun 1945</p>','<p>Memutus pembubaran partai politik dan memutus sengketa hasil pemilihan umum</p>','<p>Mengusulkan pengangkatan hakim agung dan mempunyai wewenang lain dalam rangka menjaga dan menegakkan kehormatan, keluhuran martabat, serta perilaku hakim</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('94','13','30','<p>Kewenangan Komisi Pemberantasan Korupsi dalam melakukan penyelidikan, penyidikan, dan penuntutan tindak pidana korupsi meliputi, (1) tindak pidana korupsi yang melibatkan aparat penegak hukum, penyelenggara negara, dan orang lain yang ada kaitannya dengan tindak pidana korupsi yang dilakukan oleh aparat penegak hukum atau penyelenggara negara; (2) menyangkut kerugian negara paling sedikit Rp 1.000.000.000 (satu miliar rupiah); dan (3)&hellip;.</p>','1','<p>Tindak pidana yang dilakukan instansi yang berwenang melakukan pemberantasan tipikor</p>','<p>Tindakan untuk melakukan supervisi terhadap instansi yang berwenang melakukan pemberantasan tipikor</p>','<p>Tindakan yang mendapat perhatian dan meresahkan masyarakat</p>','<p>Tindak pidana untuk melakukan tindakan-tindakan pencegahan tipikor</p>','<p>Tindakan untuk melakukan monitor terhadap penyelenggaraan pemerintahan negara</p>\r\n<p>&nbsp;</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('95','13','31','<p>Salah satu tugas Komisi Pemberantasan Korupsi dalam melaksanakan kewenangannya adalah melaksanakan langkah atau upaya pencegahan. Cara yang bisa ditempuh seperti berikut, kecuali....</p>','1','<p>Melakukan pendaftaran dan pemeriksaan terhadap laporan harta kekayaan penyelenggara negara</p>','<p>Menerima laporan dan menetapkan status gratifikasi</p>','<p>Menyelenggarakan program pendidikan anti korupsi pada setiap jenjang pendidikan</p>','<p>Mengambil alih penyidikan atau penuntutan terhadap pelaku tindak pidana korupsi yang sedang dilakukan oleh kepolisian atau kejaksaan</p>','<p>Merancang dan mendorong terlaksananya program sosialisasi pemberantasan tindak pidana korupsi</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('96','13','32','<p>Mengacu pada ketentuan hukum yang berlaku maka prinsip penting negara hukum adalah adanya jaminan penyelenggaraan kekuasaan kehakiman yang merdeka, bebas dari pengaruh kekuasaan lainnya untuk menyelenggarakan peradilan guna menegakkan hukum dan keadilan. Hal tersebut selaras dengan ketentuan...</p>','1','<p>UU 48 Tahun 2009 tentang kekuasaan kehakiman</p>','<p>Pasal 1 Ayat (3) UUD NRI Tahun 1945</p>','<p>Pasal 24 Ayat (1) UUD NRI Tahun 1945</p>','<p>Pasal 27 Ayat (1) UUD NRI Tahun 1945</p>','<p>Pasal 28 D Ayat (1) UUD NRI Tahun 1945</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('97','13','33','<p>Hukum merupakan petunjuk berperilaku dalam kehidupan. Maka masyarakat harus menyadari akan adanya perintah dan larangan dalam penerapan hukum. Pernyataan tersebut merupakan makna hukum yang berfungsi ...</p>','1','<p>Alat pengatur tata tertib dan keteraturan hubungan masyarakat</p>','<p>Sarana untuk mewujudkan keadilan sosial</p>','<p>Sarana penggerak pembangunan</p>','<p>Alat penyelesaian sengketa</p>','<p>Alat untuk mewujudkan ketenteraman sosial</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('98','13','34','<p>Salah satu hak kekayaan industri yang merupakan hak ekslusif yang diberikan negara atas hasil kreasi seseoran, dalam jangka waktu tertentu melaksanakan sendiri dan/atau memberikan persetujuannya kepada pihak lain untuk melaksanakan hak tersebut disebut ...</p>','1','<p>Paten</p>','<p>Penanggulangan praktik persaingan curang</p>','<p>Desain tata letak sirkuit terpadu</p>','<p>Desain industri</p>','<p>Rahasia dagang</p>','D','','','','','','','');
