INSERT INTO `soal` VALUES ('107','13','43','<p>Sebuah tatanan yang di dalamnya hukum mempunyai kekuasaan mutlak untuk mengatur kehidupan berbangsa dan bernegara, serta menempatkan hukum dalam posisi tertinggi dalam melindungi seluruh lapisan masyarakat sering disebut sebagai....</p>','1','<p>keadilan sosial</p>','<p>absolutisme hukum</p>','<p>perlindungan dan penegakan hukum</p>','<p>supremasi hukum</p>','<p>kemutlakan hukum</p>','D','','','','','','','');
