INSERT INTO `soal` VALUES ('110','13','46','<p>Hukum memuat peraturan-peraturan berupa perintah dan larangan yang mengatur tingkah laku manusia dalam hidup bermasyarakat. Dari penyataan tersebut menggambarkan hukum mempunyai sifat ...</p>','1','<p>memaksa</p>','<p>mengatur</p>','<p>menyeluruh</p>','<p>memilih</p>','<p>memerintah</p>','B','','','','','','','');
