INSERT INTO `soal` VALUES ('113','13','49','<p>Faktor yang menyebabkan terjadinya pelanggaran hak dan pengingkaran kewajiban sebagai warga negara adalah ...</p>','1','<p>Sumber Daya Alam</p>','<p>Sumber Daya Manusia</p>','<p>kesadaran berbangsa dan bernegara yang rendah</p>','<p>sosok kepala negara dan kepala pemerintahan</p>','<p>konstitusi di negara tersebut</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('114','13','50','<p>Ada dua cara yang dapat dilakukan untuk mengatasi pengingkaran kewajiban warga negara, yaitu cara preventif dan represif. Berikut ini yang merupakan contoh represif untuk mengatasi pengingkaran tersebut adalah ....</p>','1','<p>pendidikan</p>','<p>tulisan</p>','<p>spanduk</p>','<p>iklan layanan</p>','<p>denda</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('118','21','1','<p>Jika anda melihat anak-anak jalanan dan melakukan pekerjaan-pekerjaan yang seharusnya tidak mereka lakukan, seperti meminta-minta, menjadi pemulung, mengamen dan sebagainya pada jam sekolah , maka pada dasarnya mereka mengalami masalah yakni tidak terpenuhinya hak asasi dalam bidang&hellip;</p>','1','<p>ekonomi</p>','<p>politik</p>','<p>sosial budaya</p>','<p>hukum</p>','<p>pribadi</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('119','21','2','<p>Perhatikan ciri-ciri hak asasi manusia di bawah ini !</p>\r\n<ol>\r\n<li>Hakiki</li>\r\n<li>Tunggal</li>\r\n<li>Tidak dapat dibagi</li>\r\n<li>Ketergantungan</li>\r\n<li>Universal</li>\r\n</ol>\r\n<p>Dari data diatas, yang merupakan ciri HAM di tunjukkan oleh nomor ..</p>','1','<p>(1), (2), dan (3)</p>','<p>(1), (2), dan (4)</p>','<p>(1), (3), dan (5)</p>','<p>(3), (4), dan (5)</p>','<p>(4), (5), dan (6)</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('120','21','3','<p>Pancasila memiliki nilai dasar, nilai instrumental, dan nilai praksis. Nilai-nilai yang dilaksanakan dalam kenyataan hidup sehari-hari seperti saling menghormati, toleransi, dan lain-lain, disebut nilai ....</p>','1','<p>Dasar</p>','<p>Intrumental</p>','<p>Praksis</p>','<p>Pragmatis</p>','<p>Realistis</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('121','21','4','<p>Pengamalan terhadap nilai-nilai Pancasila dengan cara mematuhi peraturan perundangan yang berlaku, misalnya menggunakan helm saat mengendarai sepeda motor adalah wujud pengamalan nilai Pancasila secara....</p>','1','<p>Objektif</p>','<p>Subjektif</p>','<p>Praksis</p>','<p>Realistis</p>','<p>Pragmatis</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('122','21','5','<p>Hubungan antara hak asasi manusia dengan Pancasila dapat dijabarkan dalam sila &ndash; sila Pancasila, yang sesuai dengasila ketiga adalah..</p>','1','<p>Menjamin hak kemerdekaan untuk memeluk agama, melaksanakan ibadah, dan menghormati perbedaan agama.</p>','<p>Pertama Menempatkan setiap warga negara pada kedudukan yang sama dalam hukum serta memiliki kewajiban dan hak-hak yang sama untuk mendapatkan jaminan dan perlindungan hukum</p>','<p>Mengamanatkan adanya unsur pemersatu di antara warga negara dengan semangat rela bekorban dan menempatkan kepentingan bangsa dan negara di atas kepentingan pribadi&nbsp;atau golongan.</p>','<p>Dicerminkan dalam kehidupan pemerintahan, bernegara, dan bermasyarakat yang demokratis</p>','<p>Mengakui hak milik dan jaminan sosial secara perorangan yang dilindungi oleh negara serta berhak mendapatkan pekerjaan dan perlindungan</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('123','21','6','<ol>\r\n<li>Perhatikan pernyataan berikut ini !</li>\r\n<li>melapor ke pihak kepolisian</li>\r\n<li>menghubungi ketua RT setempat</li>\r\n<li>bersama masyarakat mengamankan korban</li>\r\n<li>mengancam pelaku untuk bertanggungjawab</li>\r\n<li>mencari massa untuk menghakimi pelaku</li>\r\n</ol>\r\n<p>Jika kalian menemukan kasus pelanggaran HAM di lingkungan sekitarmu seperti adanya penganiayaan yang dilakukan sekelompok orang terhadap orang lain, maka yang harus kalian lakukan adalah&hellip;</p>','1','<p>(1), (2), dan (3)</p>','<p>(1), (2), dan (4)</p>','<p>(1), (3), dan (5)</p>','<p>(2), (3), dan (4)</p>','<p>(3), (4), dan (5)</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('124','21','7','<p>Salah satu bentuk tindakan pencegahan yang dapat dilakukan untuk mengatasi berbagai kasus pelanggaran HAM adalah meningkatkan penyebarluasan prinsip- prinsip HAM kepada masyarakat melalui pendidikan formal , hal ini dapat dilakukan dengan cara&hellip;.</p>','1','<p>Melalui pembentukan peradilan HAM</p>','<p>Pembentukan masyarakat peduli HAM</p>','<p>Melalui kurikulum sekolah yang memuat HAM</p>','<p>Melalui ceramah-ceramah keagamaan di masyarakat</p>','<p>Melalui kampanye partai-partai politik</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('125','21','8','<p>Perhatikan data berikut :</p>\r\n<ol>\r\n<li>Sikap egois</li>\r\n<li>Penyalahgunaan kekuasaan</li>\r\n<li>Rendahnya kesadaran HAM</li>\r\n<li>Sikap tidak toleran</li>\r\n<li>Penyalahgunaan teknologi</li>\r\n</ol>\r\n<p>Dari data diatas yang merupakan faktor internal yang mendorong terjadinya pelanggaran hak asasi manusia adalah&hellip;</p>','1','<p>1),2),3)</p>','<p>1),2),4)</p>','<p>1),3),4)</p>','<p>2),3),5)</p>','<p>3),4),5)</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('126','21','9','<p>Setiap perbuatan seseorang atau sekelompok orang termasuk aparat negara, baik disengaja maupun tidak disengaja atau kelalaian yang secara hukum mengurangi, menghalangi, membatasi dan atau mencabut hak asasi manusia seseorang atau kelompok orang yang dijamin oleh undang-undang dan tidak mendapatkan atau dikhawatirkan tidak akan memperoleh penyelesaian hukum yang adil dan benar berdasarkan mekanisme hukum yang merupakan pengertian dari&hellip;</p>','1','<p>Pelanggaran hak asasi manusia</p>','<p>Kelalaian hak asasi manusia</p>','<p>Pelanggaran hukum</p>','<p>Perbuatan hukum</p>','<p>Peristiwa hukum</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('127','21','10','<ol>\r\n<li>Perhatikan data berikut :</li>\r\n<li>Membunuh anggota kelompok</li>\r\n<li>Mengakibatkan penderitaan fisik dan mental berat pada anggota kelompok</li>\r\n<li>Perampasan kemerdekaan atau perampasan kebebasan fisik</li>\r\n<li>Memisahkan anak secara paksa ke dalam kelompok tertentu</li>\r\n<li>Perkosaan, perbudakan seksual, pelacuran secara paksa</li>\r\n</ol>\r\n<p>Dari pernyataan diatas, yang termasuk dalam kejahatan genosida sesuai dengan UU nomor 26 tahun 2000 adalah&hellip;.</p>','1','<p>1), 2), 3)</p>','<p>1), 2), 4)</p>','<p>2), 3), 4)</p>','<p>2), 3), 5)</p>','<p>3), 4), 5)</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('128','21','11','<p>Perhatikan data berikut :</p>\r\n<ol>\r\n<li>Sikap egois</li>\r\n<li>Penyalahgunaan kekuasaan</li>\r\n<li>Rendahnya kesadaran HAM</li>\r\n<li>Sikap tidak toleran</li>\r\n<li>Penyalahgunaan teknologi</li>\r\n</ol>\r\n<p>Dari data diatas yang merupakan faktor internal yang mendorong terjadinya</p>\r\n<p>pelanggaran Hak asasi manusia adalah&hellip;</p>','1','<p>1), 2), 3)</p>','<p>1), 2), 4)</p>','<p>1), 3), 4)</p>','<p>2), 3), 5)</p>','<p>3), 4), 5)</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('129','21','12','<p>Penyalahgunaan teknologi termasuk dalam faktor eksternal yang menjadi penyebab terjadinya pelanggaran HAM, berikut ini yang merupakan contoh penyalahgunaan teknologi yang mengakibatkan pelanggaran HAM adalah&hellip;</p>','1','<p>Kesulitan ekonomi yang menyebabkan seseorang melakukan tindakan kejahatan bahkan sampai membunuh</p>','<p>Seseorang yang menggunakan kekuasaannya untuk melakukan tindakan korupsi</p>','<p>Seseorang yang dengan sengaja menggunakan jejaring sosial untuk melakukan penipuan dan kemudian menculik korban</p>','<p>Aparat penegak hukum yang bertindak sewenang-wenang terhadap masyarakat</p>','<p>Seorang pengusaha yang tidak memperdulikan hak-hak buruhnya</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('130','21','13','<p>Dalam berbagai kasus pelanggaran HAM yang terjadi di Indonesia baik yang dilakukan oleh pemerintah maupun masyarakat, pelanggaran HAM tersebut mencerminkan&hellip;</p>','1','<p>Masyarakat yang demokratis namun belum dewasa</p>','<p>Masyarakat yang harmonis namun pemerintahan yang tidak stabil</p>','<p>Masyarakat yang liberal dan bersikap individualis</p>','<p>Masyarakat yang mementingkan kepentingan ekonomi semata dan berjiwa sosial</p>','<p>Kelalaian masyarakat atas pelaksanaan kewajiban asasi manusia</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('131','21','14','<p>Pelanggaran HAM dapat terjadi di mana saja dan kapan saja, tanpa mengenal status, jenis kelamin dan usia. Oleh karena itu, pemerintah dapat melakukan upaya pemajuan, penghormatan dan penegakan HAM berupa...</p>','1','<p>membentuk peraturan perundang-undangan tentang pencucian uang</p>','<p>melakukan perlindungan kepada para saksi dan korban jika diminta</p>','<p>membentuk Komisi untuk orang hilang dan korban tindak kekerasan (Kontras)</p>','<p>pembentukan pengadilan HAM yang akan menangani kasus pelanggaran HAM</p>','<p>penanaman nilai Pancasila kepada sebagian peserta didik melalui pembelajaran</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('132','21','15','<p>Berikut yang bukan merupakan langkah-langkah yang dilakukan oleh pemerintah untuk menegakkan HAM di Indonesia adalah&hellip;</p>','1','<p>Pembentukan komisi nasional Hak Asasi Manusia</p>','<p>Pembentukan undang-undang HAM</p>','<p>Pembentukan peradilan HAM</p>','<p>Membentuk mahkamah HAM</p>','<p>Ratifikasi Instrumen HAM Internasional</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('133','21','16','<p>Secara etimologis, demokrasi berasal dari bahasa Yunani, yaitu &ldquo;demos&rdquo; dan &ldquo;kratos&rdquo;&rsquo; yang artinya&hellip;.</p>','1','<p>kekuasaan negara</p>','<p>kekuasaan pemerintah</p>','<p>pemerintahan rakyat</p>','<p>pemerintahan berdaulat</p>','<p>pemerintahan dalam arti luas</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('134','21','17','<p>Perhatikan hal-hal di bawah ini</p>\r\n<ol>\r\n<li>Pemerintahan berdasarkan kehendak dan kepentingan umum ( rakyat )</li>\r\n<li>Adanya pemisahan atau pembagian kekuasaan</li>\r\n<li>Adanya pertanggungjawaban oleh pelaksana pemerintahan / eksekutif</li>\r\n<li>Kekuasaan mayoritas</li>\r\n<li>Tirani minoritas</li>\r\n</ol>\r\n<p>pemerintahan yang baik adalah yang demokratis. Adapun Ciri &ndash; ciri pokok pemerintahan yang demokratis ditujukan oleh nomor..</p>','1','<p>1, 2, dan 3</p>','<p>2, 3, dan 4</p>','<p>3, 4, dan 5</p>','<p>1, 3, dan 4</p>','<p>2, 3, dan 5</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('135','21','18','<p>Prinsip-prinsip demokrasi yang berlaku universal, yaitu mencakup &hellip;</p>','1','<p>keterlibatan warga negara dalam pembuatan keputusan</p>','<p>tingkat perbedaan tertentu diantara warga negara</p>','<p>tidak adanya bebasan atau kemerdekaan tertentu yang diakui dan dipakai oleh para warga negara</p>','<p>penegakan hukum yang sepihak</p>','<p>pemilu yang bersifat tertutup</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('136','21','19','<p>Berdasar titik berat yang menjadi perhatiannya demokrasi dapat dibedakan atas..</p>','1','<p>Formal, material, gabungan</p>','<p>Langsung dan tidak langsung</p>','<p>Konstitusional dan rakyat</p>','<p>Terbuka dan tertutup</p>','<p>Umum dan khusus</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('137','21','20','<p>Setiap negara demokrasi harus memenuhi 2 asas pokok, yaitu pengakuan partisipasi rakyat di dalam pemerintahan dan &hellip;</p>','1','<p>tanggap terhadap kepentingan bersama</p>','<p>pengakuan harkat dan martabat manusia</p>','<p>tidak diskriminasi terhadap warga negaranya</p>','<p>memiliki wakil-wakil rakyat dalam pemerintahan</p>','<p>memiliki undang-undang dan badan penegak hukum</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('138','21','21','<p>Perbedaan ideologi Pancasila dengan liberalisme di bidang politik adalah Pancasila mengutamakan keseimbangan antara hak dan kewajiban, sementara liberalisme mengutamakan...</p>','1','<p>persamaan pendapat dan oposisi yang bersifat liberal</p>','<p>kepentingan masyarakat dan kebebasan individu</p>','<p>kebebasan parpol dan pembatasan parpol</p>','<p>sistem banyak partai dan sistem dua partai</p>','<p>sistem presidensial dan sistem parlementer</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('139','21','22','<p>Contoh sikap terhadap putusan musyawarah yang sesuai dengan demokrasi Pancasila adalah&hellip;..</p>','1','<p>Menghormati dan menerimanya dengan ikhlas dan penuh tanggungjawab</p>','<p>Menerima saja karena telah diputuskan oleh pimpinan</p>','<p>Mengakui dengan senang hati dan tanggung jawab</p>','<p>Menerima karena sudah menjadi kebiasaan rapat</p>','<p>Menerima dan menjalankan dengan tanggung jawab</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('140','21','23','<p>Pehatikan hal-hal berikut</p>\r\n<ol>\r\n<li>persamaan bagi seluruh rakyat Indonesia,</li>\r\n<li>keseimbangan antara hak dan kewajiban,</li>\r\n<li>pelaksanaan kebebasan yang bertanggungjawab secara moral kepada Tuhan Yang Maha Esa, diri sendiri dan orang lain,</li>\r\n<li>mewujudkan rasa keadilan sosial,</li>\r\n<li>pengambilan keputusan dengan musyawarah mufakat,</li>\r\n<li>mengutamakan persatuan nasional dan kekeluargaan,</li>\r\n<li>menjunjung tinggi tujuan dan cita &ndash; cita</li>\r\n</ol>\r\n<p>Yang merupakan prinsip-prinsip demokrasi Pancasila adalah....</p>','1','<p>1, 2, 3, dan 5</p>','<p>2, 3, 4, dan 6</p>','<p>3, 4, 5 dan 7</p>','<p>2, 3, 4, dan 6</p>','<p>4, 5, 6, dan 7</p>','D','','','','','','','');
INSERT INTO `soal` VALUES ('141','21','24','<p>Perhatikan penyimpangan-penyimpangan di bawah ini!</p>\r\n<ol>\r\n<li>Pengekangan hak di bidang politik</li>\r\n<li>Pembatasan wewenang Presiden</li>\r\n<li>Pengangkatan Presiden seumur hidup</li>\r\n<li>Adanya program penembakan misteriusdalam menciptakan keamana</li>\r\n<li>Pembubaran DPR hasil pemilu oleh Presiden</li>\r\n</ol>\r\n<p>Dari pernyataan di atas yang merupakan penyimpangan pada masa demokrasi terpimpin ditunjukkan nomor &hellip;.</p>','1','<p>1), 2), 3)</p>','<p>1), 2), 4)</p>','<p>1), 3), 5)</p>','<p>2), 3), 4)</p>','<p>3), 4), 5)</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('142','21','26','<p>Perhatikan pernyataan berikut ini !</p>\r\n<ol>\r\n<li>keseimbangan antara hak dan kewajiban</li>\r\n<li>pemilu yang demokratis</li>\r\n<li>sistem peradilan yang independen</li>\r\n<li>mengutamakan persatuan nasional dan kekeluargaan</li>\r\n<li>menjunjung tinggi cita-cita dan tujuan nasional</li>\r\n</ol>\r\n<p>Berdasarkan pernyataan diatas, yang termasuk prinsip-prinsip demokrasi Pancasila adalah&hellip;</p>','1','<p>1,2,3</p>','<p>1,2,4</p>','<p>1,2,5</p>','<p>1,3,5</p>','<p>1,4,5</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('143','21','25','<p>Demokrasi liberal pernah dilaksanakan di Indonesia dari tahun 1950-1959, pada masa pada masa demokrasi liberal, lebih menekankan pada kebebasan individu, persamaan hukum, dan hak asasi manusia bagi warga negaranya. Hal negatif yang terjadi pada demokrasi liberal ini adalah&hellip;</p>','1','<p>mengakibatkan instabilitas baik di bidang politik, ekonomi maupun hankam</p>','<p>Jumlah sekolah bertambah</p>','<p>Pemerintah pusat mendapat tantangan dari daerah seperti PRRI</p>','<p>Badan peradilan menikmati kebebasannya dalam menjalankan fungsinya</p>','<p>Pers semakin tertekan</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('144','21','27','<p>Perhatikan pernyataan di bawah ini!</p>\r\n<ol>\r\n<li>Keterlibatan warga negara hanya dalam pemilu</li>\r\n<li>Pengambilan keputusan dengan musyawarah mufakat</li>\r\n<li>Keterlibatan warga negara dalam pembuatan keputusan politik</li>\r\n<li>Tingkat persamaan tertentu diantara warga negara</li>\r\n<li>Suatu sistem perwakilan</li>\r\n</ol>\r\n<p>Dari pernyataan di atas yang merupakan prinsip-prinsip budaya demokrasi secara universal ditunjukkan nomor &hellip;</p>','1','<p>1, 2, 3</p>','<p>1, 3, 4</p>','<p>1, 4, 5</p>','<p>2, 3, 4</p>','<p>3, 4, 5</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('145','21','28','<p>Perhatikan pernyataan berikut ini !</p>\r\n<ol>\r\n<li>pemilihan ketua RT</li>\r\n<li>pemilihan kepala desa</li>\r\n<li>pemilihan ketua karang taruna</li>\r\n<li>pemilihan ketua OSIS</li>\r\n<li>pemilihan presiden</li>\r\n</ol>\r\n<p>Berdasarkan pernyataan diatas, yang termasuk contoh perilaku yang mencerminkan budaya demokrasi dalam lingkungan masyarakat adalah&hellip;..</p>','1','<p>1,2,3</p>','<p>1,2,4</p>','<p>1,3,4</p>','<p>2, 3, 4</p>','<p>3, 4, 5</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('146','21','29','<p>Perhatikan data dibawah ini !</p>\r\n<ol>\r\n<li>Hukum Tata Negara (HTN)</li>\r\n<li>Hukum Administrasi Negara (HAN)</li>\r\n<li>Hukum Perdata</li>\r\n<li>Hukum Pidana</li>\r\n<li>Hukum Acara Pidana</li>\r\n</ol>\r\n<p>Tata hukum yang merupakan bagian dari hukum positif di Indonesia, adalah &hellip;</p>','1','<p>1,2,3,4</p>','<p>1,2,4,5</p>','<p>1,3,4,5</p>','<p>2,3,4,5</p>','<p>1,2,3,4,5</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('147','21','30','<p>Segala warga negara bersamaan kedudukannya di dalam hukum dan pemerintahan dan wajib menjunjung hukum dan pemerintahan itu dengan tidak ada kecualinya</p>\r\n<p>Hal ini menunjukan adanya keseimbangan antara hak dan kewajiban dan tidak adanya diskriminasi di antara warga negara mengenai kedua hal ini. Pernyataan tersebut terdapat dalam UUD NRI Tahun 1945 &hellip;.</p>','1','<p>pasal 26 ayat 1</p>','<p>pasal 27 ayat 1</p>','<p>pasal 28</p>','<p>pasal 30 ayat 3</p>','<p>pasal 34 ayat 2</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('148','21','31','<p>Lembaga tertinggi dalam susunan lembaga peradilan di Indonesia adalah &hellip;.</p>','1','<p>Pengadilan Umum</p>','<p>Pengadilan Agama</p>','<p>Peradilan Militer</p>','<p>Pengadilan Tata Usaha Negara</p>','<p>Mahkamah Agung</p>','E','','','','','','','');
INSERT INTO `soal` VALUES ('149','21','32','<p>Pengadilan Tinggi merupakan organ kekuasaan kehakiman dalam lingkungan Peradilan Umum yang berkedudukan di tingkat &hellip;</p>','1','<p>Provinsi</p>','<p>Kecamatan</p>','<p>Ibukota negara</p>','<p>Kabupaten/Kota</p>','<p>Kelurahan</p>','A','','','','','','','');
