INSERT INTO `soal` VALUES ('153','21','36','<p>Perhatikan data dibawah ini !</p>\r\n<ol>\r\n<li>Mengadili pada tingkat pertama dan terakhir UU terhadap UUD tahun 1945</li>\r\n<li>Memutus sengketa kewenangan lembaga negara yang kewenangannya diberikan oleh UUD 1945</li>\r\n<li>Mengusulkan pengangkatan hakim Agung serta menegakan dan menjaga kehormatan dan martabat hakim</li>\r\n<li>Lembaga yang bebas dan mandiri dengan tugas khusus untuk memeriksa pengelolaan dan tanggung jawab keuangan negara</li>\r\n<li>Mengajukan rancangan undang-undang yang berkaitan dengan otonomi daerah dan yang berkaitan dengan daerah</li>\r\n<li>Mengubah dan menetapkan UUD, melantik Presiden dan atau Wakil Presiden dan hanya memberhentikan Presiden dan wakil Presiden pada masa</li>\r\n</ol>\r\n<p>Berdasarkan data tersebut diatas, yang merupakan wewenang dari Mahkamah Konstitusi adalah pada nomor ....</p>','1','<p>1 dan 2</p>','<p>2 dan 5</p>','<p>3 dan 6</p>','<p>4 dan 5</p>','<p>5 dan 6</p>','A','','','','','','','');
