INSERT INTO `soal` VALUES ('157','21','40','<p>Dalam Hukum apabila pihak-pihak yang bersangkutan telah membuat peraturan sendiri dalam suatu Biasanya dilakukan dalam perkara-perkara perdataan. Contoh: Aviscena meminjam uang pada Reyhan dan berjanji akan mengembalikannya sebulan kemudian. Ternyata sudah melewati batas yang telah ditentukan Aviscena tidak mau melunasi utangnya dengan alasan belum punya uang. Menurut Pasal 1365 KUH Perdata, yang menyatakan: Tiap perbuatan melanggar hukum, yang membawa kerugian kepada seorang lain, mewajibkan orang yang karena salahnya menerbitkan kerugian itu, mengganti kerugian tersebut. Berdasarkan pasal tersebut&nbsp;&nbsp; ada dua: 1) Kemungkinan pertama Aviscena wajib membayar utang. 2) Kemungkinan kedua Aviscena dibebaskan/diperpanjang pembayarannya asal ada kata sepakat antara Aviscena dan Reyhan,</p>\r\n<p>Dalam kasus tersebut termasuk penggolongan hukum berdasarkan...</p>','1','<p>sifatnya hukum</p>','<p>isinya hukum</p>','<p>waktu berlakunya</p>','<p>tempat berlakunya</p>','<p>cara mempertahankannya</p>','B','','','','','','','');
