INSERT INTO `soal` VALUES ('267','37','5','<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"font-weight: 400;\">US Ambassador to Indonesia Robert Blake celebrated for the first time Thanksgiving Day with members of the Osing ethnic group in Banyuwangi, East Java, as part of a visit in November. The visit also marked the International Day for Tolerance, </span><span style=\"font-weight: 400;\">which</span><span style=\"font-weight: 400;\"> reaffirms human rights.</span></p>\r\n<p><span style=\"font-weight: 400;\">Apart from being entertained by traditional dances and typical Osing cuisine, Blake also released young turtles on Boom Beach. &ldquo;I&rsquo;m happy to be able to celebrate Thanksgiving in Banyuwangi. This will hopefully strengthen international and interfaith harmony, as well as a mutual appreciation of differences,&rdquo; he said.</span></p>\r\n<p><span style=\"font-weight: 400;\">Decades ago, Banyuwangi was only minor regency at the eastern tip of Java serving as a transit point for tourist going to Bali. In the 1990s, Banyuwangi was </span><span style=\"font-weight: 400;\">notorious</span><span style=\"font-weight: 400;\"> for its black magic practices and protests against the regent. At present, however, Banyuwangi is the only city in Indonesia that has received the Charter for Compassion from the Compassion Action International for its appreciation of the values of compassion, humanism and pluralism. With the charter, Banyuwangi is one of 40 &ldquo;cities of compassion&rdquo;, according to the organization.</span></p>\r\n<p><span style=\"font-weight: 400;\">&ldquo;The appreciation of pluralism in Indonesia is perpetuated in the Constitution of the state, and this clearly noticed in Banyuwangi, where Osing culture and traditions are preserved, recognized and observed,&rdquo; Blake said, as conveyed by US Consul General Joaquin F. Monseratte.</span></p>\r\n<p><strong>Why did Blake go to Banyuwangi?</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','1','<p><span style=\"font-weight: 400;\">To lecture in human rights issues.</span></p>','<p><span style=\"font-weight: 400;\">To entertain people by traditional dances</span></p>','<p><span style=\"font-weight: 400;\">To mark his appointment as an ambassador.</span></p>','<p><span style=\"font-weight: 400;\">To celebrate Thanksgiving Day with an ethnic group.</span></p>','','D','','','','','','','');
