INSERT INTO `soal` VALUES ('299','37','8','<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Mark Elliot Zuckerberg</strong><span style=\"font-weight: 400;\"> (born May 14, 1984) is an American computer programmer and entrepreneur. He is best known as one of five co-founders of the social networking website Facebook. Zuckerberg is the chairman and chief executive of Facebook, Inc. His personal wealth, as of July 2015, is estimated to be $38.6 billion. Zuckerberg receives a one dollar salary as CEO of Facebook.</span></p>\r\n<p><span style=\"font-weight: 400;\">Together with his college roommates and fellow Harvard University students Eduardo Saverin, Andrew McCollum, Dustin Moskovitz, and Chris Hughes, he launched Facebook from Harvard University&rsquo;s dormitory rooms. The group then introduced Facebook onto other campuses nationwide and moved to Palo Alto, California shortly afterwards. In 2007, at the age of 23, Zuckerberg became a billionaire as a result of Facebook&rsquo;s success. The number of Facebook users worldwide reached a total of one billion in 2012. Zuckerberg was involved in various legal </span><span style=\"font-weight: 400;\">disputes</span><span style=\"font-weight: 400;\"> that were initiated by others in the group, who claimed a share of the company based upon their involvement during the development phase of Facebook.</span></p>\r\n<p><strong>Why does the writer compose the text?</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','1','<p><span style=\"font-weight: 400;\">To launch a famous program on the internet.</span></p>','<p><span style=\"font-weight: 400;\">To introduce a social media networking.</span></p>','<p><span style=\"font-weight: 400;\">To inform about American computer programs.</span></p>','<p><span style=\"font-weight: 400;\">To tell the success story of an IT specialist.</span></p>','','D','','','','','','','');
INSERT INTO `soal` VALUES ('300','37','9','<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Mark Elliot Zuckerberg</strong><span style=\"font-weight: 400;\"> (born May 14, 1984) is an American computer programmer and entrepreneur. He is best known as one of five co-founders of the social networking website Facebook. Zuckerberg is the chairman and chief executive of Facebook, Inc. His personal wealth, as of July 2015, is estimated to be $38.6 billion. Zuckerberg receives a one dollar salary as CEO of Facebook.</span></p>\r\n<p><span style=\"font-weight: 400;\">Together with his college roommates and fellow Harvard University students Eduardo Saverin, Andrew McCollum, Dustin Moskovitz, and Chris Hughes, he launched Facebook from Harvard University&rsquo;s dormitory rooms. The group then introduced Facebook onto other campuses nationwide and moved to Palo Alto, California shortly afterwards. In 2007, at the age of 23, Zuckerberg became a billionaire as a result of Facebook&rsquo;s success. The number of Facebook users worldwide reached a total of one billion in 2012. Zuckerberg was involved in various legal </span><span style=\"font-weight: 400;\">disputes</span><span style=\"font-weight: 400;\"> that were initiated by others in the group, who claimed a share of the company based upon their involvement during the development phase of Facebook.</span></p>\r\n<p><strong>How did Facebook affect Zuckerberg&rsquo;s life after 2006?</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','1','<p><span style=\"font-weight: 400;\">He decided to move to Palo, California</span></p>','<p><span style=\"font-weight: 400;\">He got involved in legal disputes in his company</span></p>','<p><span style=\"font-weight: 400;\">He became&nbsp; a billionaire at a very young age</span></p>','<p><span style=\"font-weight: 400;\">He had developed Facebook by himself</span></p>','','C','','','','','','','');
INSERT INTO `soal` VALUES ('301','37','10','<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Mark Elliot Zuckerberg</strong><span style=\"font-weight: 400;\"> (born May 14, 1984) is an American computer programmer and entrepreneur. He is best known as one of five co-founders of the social networking website Facebook. Zuckerberg is the chairman and chief executive of Facebook, Inc. His personal wealth, as of July 2015, is estimated to be $38.6 billion. Zuckerberg receives a one dollar salary as CEO of Facebook.</span></p>\r\n<p><span style=\"font-weight: 400;\">Together with his college roommates and fellow Harvard University students Eduardo Saverin, Andrew McCollum, Dustin Moskovitz, and Chris Hughes, he launched Facebook from Harvard University&rsquo;s dormitory rooms. The group then introduced Facebook onto other campuses nationwide and moved to Palo Alto, California shortly afterwards. In 2007, at the age of 23, Zuckerberg became a billionaire as a result of Facebook&rsquo;s success. The number of Facebook users worldwide reached a total of one billion in 2012. Zuckerberg was involved in various legal </span><span style=\"font-weight: 400;\">disputes</span><span style=\"font-weight: 400;\"> that were initiated by others in the group, who claimed a share of the company based upon their involvement during the development phase of Facebook.</span></p>\r\n<p><strong>&ldquo;&hellip; in various legal disputes &hellip;&rdquo; (Paragraph 2)</strong></p>\r\n<p><strong>Which of the following words is closest in meaning to the underlined word?</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','1','<p><span style=\"font-weight: 400;\">Conflicts</span></p>','<p><span style=\"font-weight: 400;\">Provisions</span></p>','<p><span style=\"font-weight: 400;\">Agreements</span></p>','<p><span style=\"font-weight: 400;\">Preparations</span></p>','','A','','','','','','','');
