INSERT INTO `soal` VALUES ('338','37','15','<p>Raisa : I don&rsquo;t know whether I will take the scholarship or not. It does not cover the plane ticket. I don&rsquo;t have enough money for it.<br />Hamish : ............<br />Raisa : Thank you a million. That&rsquo;s very kind of<br />you.</p>\r\n<p><strong>Which of the following setences best fill the blank.........?</strong></p>\r\n<p><br /><br /><br /></p>','1','<p>I&rsquo;ll find a sponsor for you, if you want.</p>\r\n<p><br /><br /><br /></p>','<p>Can you find a sponsor?</p>\r\n<p><br /><br /><br /></p>','<p>You&rsquo;d better to leave the scholarship.</p>\r\n<p><br /><br /><br /></p>','<p>I don&rsquo;t mind if you don&rsquo;t take it</p>\r\n<p><br /><br /><br /></p>','','A','','','','','','','');
