INSERT INTO `soal` VALUES ('340','37','17','<p style=\"text-align: center;\">PUBLIC NOTICE</p>\r\n<p>This is to inform all members of Staff and the General Public that the Consulate General of the Federal Republic of Nigeria, Atlanta, will be closed on Monday November 11, 2019 to observe the Veteran\'s Day holiday declared by the United States Government.</p>\r\n<p>Normal business will resume on Thursday, November 12, 2019.<br />Consulate General of Nigeria, Atlanta</p>\r\n<p><strong>What is the purpose of the text......?</strong></p>\r\n<p><br /><br /><br /></p>','1','<p>To invite the staff of the Consulate General of Nigeria to the White House.</p>\r\n<p><br /><br /><br /></p>','<p>To tell Nigeria about the Veteran\'s Day hold by the United States of America.</p>\r\n<p><br /><br /><br /></p>','<p>To announce the Veteran\'s Day celebration.</p>\r\n<p><br /><br /><br /></p>','<p>To announce the Consulate General of Nigeria closing due to the US Veteran&rsquo;s Day.</p>\r\n<p><br /><br /><br /></p>','','D','','','','','','','');
INSERT INTO `soal` VALUES ('341','37','18','<p>A Long time ago a very cruel king named Virat Singh. He was the ruler of Vijay Nagar. All citizens were fearful because of his cruelty.</p>\r\n<p>Virat has a dog named Jack, which he used to love more than anything, one fateful morning Jack died.</p>\r\n<p>Virat Singh organized last rituals for the dog, entire city came to the cremation ground.</p>\r\n<p>Virat Singh was very happy to see that people love him so much and he felt he is the most popular king in the world.</p>\r\n<p>After few days Virat Singh died, but nobody came for his funerals</p>\r\n<p>&nbsp;<strong>From the text we can infer that ......?</strong></p>\r\n<p><br /><br /><br /></p>','1','<p>nobody came to the king&rsquo;s funeral because it was far.</p>\r\n<p><br /><br /><br /></p>','<p>the people loved the dog more than the king</p>\r\n<p><br /><br /><br /></p>','<p>the dog was actually the King&rsquo;s child.</p>\r\n<p><br /><br /><br /></p>','<p>the citizens were afraid of the dog.</p>\r\n<p><br /><br /><br /></p>','','B','','','','','','','');
INSERT INTO `soal` VALUES ('342','37','19','<p>1. Being afraid Maya and Rita sat closely to each<br />other.<br />2. What a relief! The shadow was their camp leader doing an inspection.<br />3. It was midnight, but Maya and Rita were still awake.<br />4. Then, they saw a tall and big shadow outside their tent.<br />5. They peeped outside through a small hole in the tent.<br />6. Suddenly, they heard a soft voice outside.<br />7. After the campfire, all the scouts enter their tents to have a rest, including Maya and Rita.</p>\r\n<p><strong>Rearrange the following sentences into the correct and meaningful paragraph!</strong></p>\r\n<p><br /><br /><br /></p>','1','<p>7 &ndash; 3 &ndash; 6 &ndash; 4 &ndash; 1 &ndash; 5 &ndash; 2</p>\r\n<p><br /><br /><br /></p>','<p>7 &ndash; 3 &ndash; 2 &ndash; 5 &ndash; 4 &ndash; 6 &ndash; 1</p>\r\n<p><br /><br /><br /></p>','<p>7 &ndash; 3 &ndash; 4 &ndash; 5 &ndash; 2 &ndash; 1 &ndash; 6</p>\r\n<p><br /><br /><br /></p>','<p>7 &ndash; 2 &ndash; 1 &ndash; 5 &ndash; 3 &ndash; 4 &ndash; 6</p>\r\n<p><br /><br /><br /></p>','','A','','','','','','','');
