INSERT INTO `soal` VALUES ('443','36','4','<p>To : marvin</p>\r\n<p>From : Saziliman</p>\r\n<p>Subject : computer training</p>\r\n<p>&nbsp;</p>\r\n<p>Marvin,</p>\r\n<p>&nbsp;</p>\r\n<p>I am attaching the latest schedule from the Computer Training Center. As we have discussed in person, your computer skills are not quite up to normal and you would benefit from taking one of these courses. We also discussed the fact your first-year employee probationary status is still in effect and that you are required to take some training courses during this time. Please sign up for one of these courses as soon as possible. I would encourage you to choose a beginning word processing class, as your skills in that area are whole fully lacking. You have a good knowledge of database software, though you could benefit from an advanced-level class if that is what interests you most. The choice, of course, is up to you, but I recommend word processing. In choosing your class schedule, please remember that you must be present at our weekly staff meetings (Wednesday afternoon at 2:00). As soon as you have decided on a course and schedule, please contact Elizabeth Mortimer in the Human Resources Department and she will take care of the registration process fro you. We at NZ, Inc. Will, of course, take care of all the fees. All you have to do is attend the classes. Please e-mail me as soon as you are rigistered for a course.</p>\r\n<p>&nbsp;</p>\r\n<p>Sam Silliman</p>\r\n<p><strong>The company suggested that Marvin take a computer course in order ........</strong></p>','1','<p>To be promoted as director of the center</p>','<p>To meet the qualification it require</p>','<p>To handle the computer training center</p>','<p>To support his performance in the center</p>\r\n<p>&nbsp;</p>','<p>To undertake his probationary period in the company</p>','C','','','','','','','');
INSERT INTO `soal` VALUES ('444','36','5','<p>To : marvin</p>\r\n<p>From : Saziliman</p>\r\n<p>Subject : computer training</p>\r\n<p>&nbsp;</p>\r\n<p>Marvin,</p>\r\n<p>&nbsp;</p>\r\n<p>I am attaching the latest schedule from the Computer Training Center. As we have discussed in person, your computer skills are not quite up to normal and you would benefit from taking one of these courses. We also discussed the fact your first-year employee probationary status is still in effect and that you are required to take some training courses during this time. Please sign up for one of these courses as soon as possible. I would encourage you to choose a beginning word processing class, as your skills in that area are whole fully lacking. You have a good knowledge of database software, though you could benefit from an advanced-level class if that is what interests you most. The choice, of course, is up to you, but I recommend word processing. In choosing your class schedule, please remember that you must be present at our weekly staff meetings (Wednesday afternoon at 2:00). As soon as you have decided on a course and schedule, please contact Elizabeth Mortimer in the Human Resources Department and she will take care of the registration process fro you. We at NZ, Inc. Will, of course, take care of all the fees. All you have to do is attend the classes. Please e-mail me as soon as you are rigistered for a course.</p>\r\n<p>&nbsp;</p>\r\n<p>Sam Silliman</p>\r\n<p><strong>Marvin will register for the class by ....</strong></p>\r\n<p>&nbsp;</p>','1','<p>Talking with the human resources officer</p>','<p>Visiting the training center website</p>','<p>Calling the training center</p>','<p>E-mailing Sam Silliman</p>','<p>Meeting Silliman</p>\r\n<p>&nbsp;</p>','A','','','','','','','');
INSERT INTO `soal` VALUES ('445','36','6','<p><strong>Hotel Work :</strong></p>\r\n<p><strong>One Month Training Course</strong></p>\r\n<p>Suitable young men and women are invited to apply for places on the one month training course on hotel work organized by the Hong Kong Institute of Hotel Management. Tuition is free of charge and students who successfully complete the course will be offered employment in the Colony&rsquo;s leading hotels.</p>\r\n<p>&nbsp;</p>\r\n<p>The Training Course will take place from Monday 21<sup>st</sup>&nbsp;July to Friday 22<sup>nd</sup>&nbsp;August, from 9 a.m. to 4.30 p.m. daily, except Saturdays and Sundays.</p>\r\n<p>&nbsp;</p>\r\n<p>Applications for places on the course are welcome for students now in their third year at secondary school, who have good knowledge of English, and have interest in hotel work.</p>\r\n<p>Application forms may be obtained from :</p>\r\n<p>The Hong Kong Institute of Management,</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Box 948,</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The South China Times.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;<strong> Those who successfully complete the course will be given .......</strong></p>','1','<p>free tuition</p>\r\n<p>&nbsp;</p>','<p>a further training course</p>\r\n<p>&nbsp;</p>','<p>jobs in big hotels in the colony</p>\r\n<p>&nbsp;</p>','<p>a chance to stay in the colony&rsquo;s leading hotels for one month</p>\r\n<p>&nbsp;</p>','<p>Membership of the Hong Kong Institute of Hotel management</p>','D','','','','','','','');
