INSERT INTO `soal` VALUES ('519','37','24','<p>Boy: Hey, what are you doing?<br />Girl: I&rsquo;d like to take the book on the top of the shelf, but I can&rsquo;t reach it.<br />Boy: Which book?<br />Girl: That one. It&rsquo;s entitled Creative Ideas.<br />Boy: &hellip;&hellip;..<br />How will the boy likely respond?</p>\r\n<p><br /><br /><br /></p>','1','<p>I am proud of having a friend who likes reading</p>\r\n<p><br /><br /><br /></p>','<p>Don&rsquo;t worry. I&rsquo;ll take it for you</p>\r\n<p><br /><br /><br /></p>','<p>I think the book is interesting to read</p>\r\n<p><br /><br /><br /></p>','<p>I believe many people will read the book</p>\r\n<p><br /><br /><br /></p>','','B','','','','','','','');
