INSERT INTO `soal` VALUES ('524','37','27','<p>1. Being afraid Maya and Rita sat closely to each other.<br />2. What a relief! The shadow was their camp leader doing an inspection.<br />3. It was midnight, but Maya and Rita were still awake.<br />4. Then, they saw a tall and big shadow outside their tent.<br />5. They peeped outside through a small hole in the tent.<br />6. Suddenly, they heard a soft voice outside.<br />7. After the campfire, all the scouts enter their tents to have a rest, including Maya and Rita.<br /><strong>Rearrange the following sentences into the correct and meaningful paragraph!</strong></p>','1','<p>7 &ndash; 3 &ndash; 2 &ndash; 5 &ndash; 4 &ndash; 6 &ndash; 1</p>','<p>7 &ndash; 5 &ndash; 4 &ndash; 3 &ndash; 1 &ndash; 6 &ndash; 2</p>','<p>7 &ndash; 3 &ndash; 4 &ndash; 5 &ndash; 2 &ndash; 1 &ndash; 6</p>','<p>7 &ndash; 3 &ndash; 6 &ndash; 4 &ndash; 1 &ndash; 5 &ndash; 2</p>','','D','','','','','','','');
