INSERT INTO `soal` VALUES ('527','37','28','<p>Charles Robert Darwin was born in Shrewsbury, England, on February 12, 1809. He came from a wealthy family and never had to work. He studied medicine and theology. In 1831 he graduated from University of Cambridge with a degree of theology.<br />He began a career as a scientist quite by chancE. On December 27,1831, 22 years old Charles Darwin joined the crew of the HMS Beagle as a naturalist.The five years expedition collected hydrographic, geologic, and meteorologic data from South America and many other regions around the worlD. Darwin&rsquo;s own observation on this voyage led to his theory of natural selection.<br />Charles Darwin was greatly influenced by the geologist Adam Sedgwick and naturalist John Henslow in his development of the theory of natural selection, which was to become the foundation concept supporting the theory of evolution. Darwin&rsquo;s theory holds that environmental effects lead to varying degrees of reproductive success in individuals and groups of organisms. Natural selection tends to promote adaptation in organisms when necessary for survival. This revolutionary theory was published in 1859 in Darwin&rsquo;s now famous On the Origin of Species by Means of Natural Selection.</p>\r\n<p><strong>Charles Darwin&rsquo;s theory of evolution believed that &hellip;.</strong></p>','1','<p>environment affected natural election</p>','<p>&nbsp;organism needed adaptation to survive</p>','<p>people and nature supported to each other</p>','<p>natural selection tend to adapt organism to survive</p>','','A','','','','','','','');
INSERT INTO `soal` VALUES ('528','37','29','<p>Galileo Galilei (1564-1642) &mdash; Astronomer and Scientist. Galileo developed a superior telescope and made many significant discoveries in astronomy. He was sentenced to life imprisonment by the inquisition for his support for the Copernican theory that the sun was at the centre of the solar system.<br />Galileo was born in Florence, Italy in 1564 to a poor but noble family His parents recognized their child&rsquo;s innate intelligence and talents and so made sacrifices to have him educateD. At his father&rsquo;s insistence, Galileo studied the profitable career of medicinE. But, at the University of Pisa, Galileo became fascinated in a wide range of subjects. He was also critical of many of Aristotle&rsquo;s teaching which had dominated education for the past 2,000 years.<br />Galileo was appointed to be a mathematics professor at the University of Pisa, but his strident criticisms of Aristotle left him isolated among his contemporaries. After three years of persecution, he resigned and went to the University of Padua, where he taught maths. His entertaining lectures attracted a large following and he was able to spend the next 18 years pursuing his interests in astronomy and mechanics.</p>\r\n<p><strong>&nbsp;Something that we can learn from Galileo Galilei&rsquo;s biography is &hellip;.....</strong></p>','1','<p>We should spend 18 years to pursue our interests.</p>','<p>We should believe in something and stay faithful to it no matter how hard</p>','<p>We must always believe whatever the society believes to avoid getting persecuted.</p>','<p>We must never go against the believe of the society to avoid getting imprisoned.</p>','','B','','','','','','','');
INSERT INTO `soal` VALUES ('529','33','1','<p>Bacalah teks berikut!&nbsp;</p>\r\n<p>Kuda merupakan salah satu hewan mamalia. Hewan ini termasuk termasuk kedalam genus Equus. Hewan ini merupakan salah satu (....) peliharaan yang sering digunakan sebagai alat transportasi. Biasanya hewan ini ditunggangi oleh manusia. Selain itu, hewan ini juga sering dimanfaatkan oleh manusia untuk menarik sesuatu, misalnya untuk menarik kendaraan beroda. Oleh sebab itu, hewan ini termasuk hewan yang sangat penting secara ekonomis dan historis.&nbsp;</p>\r\n<p>Kata ilmiah yang tepat untuk melengkapi kalimat rumpang tersebut adalah ....</p>\r\n<p>&nbsp;</p>','1','<p>A. Satwa&nbsp;</p>','<p>B. Populasi&nbsp;</p>','<p>C. Habitat&nbsp;</p>','<p>D. Endermik&nbsp;</p>','<p>E. Reptil</p>','A','','','','','','','');
