INSERT INTO `soal` VALUES ('596','16','14','<ol>\r\n<li>Roronoa : &nbsp;&nbsp;&nbsp;&nbsp; Hi, Sanji! You look so busy today.</li>\r\n</ol>\r\n<p>Sanji &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; Yes, I must cook for dinner now.</p>\r\n<p>Roronoa&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; ______</p>\r\n<p>Sanji &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; Okay, I need you to cut the beef.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>What is the suitable utterance to complete the dialogue?</strong></p>\r\n<p>&nbsp;</p>','1','<p>Thanks, but I can do it.</p>\r\n<p>&nbsp;</p>','<p>Can you help me, please?</p>\r\n<p>&nbsp;</p>','<p>What can I do for you</p>\r\n<p>&nbsp;</p>','<p>Give me a hand.</p>\r\n<p>&nbsp;</p>','<p>Thanks very kind of you.</p>','B','','','','','','','');
INSERT INTO `soal` VALUES ('597','16','15','<ol>\r\n<li>Rizal :&nbsp; &nbsp;&nbsp;&nbsp; I heard there will be a concert tonight. Would you like to go with me?</li>\r\n</ol>\r\n<p>Sam&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I&rsquo;m afraid I can&rsquo;t.</p>\r\n<p>Rizal&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; &nbsp;&nbsp;&nbsp; Why? I think you really love the band.</p>\r\n<p>Sam&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; &nbsp;&nbsp; Yes, I do. But I have much work at home.<br />Rizal&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; _____.<br />Sam&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; &nbsp;&nbsp; I really appreciate your help.<br />Rizal &nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; Never mind. That&rsquo;s what friend should do.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>What should Sam say?</strong></p>\r\n<p><br /><br /></p>','1','<p>I really appreciate your help</p>\r\n<p>&nbsp;</p>','<p>I don&rsquo;t help you</p>\r\n<p>&nbsp;</p>','<p>Let me help you, then</p>\r\n<p>&nbsp;</p>','<p>I will go, too</p>\r\n<p>&nbsp;</p>','<p>Thank you</p>','C','','','','','','','');
