INSERT INTO `soal` VALUES ('615','36','7','<h1><span style=\"font-size: 12pt; font-family: \'times new roman\', times, serif;\">The Surabaya Police have arrested a man, identified only as MN, for allegedly buying an infant via Instagram. MN was arrested at his house on Jl. Karah in Jambangan district in Surabaya, East Java, on Sunday. He was found to have paid some Rp 3.8 million (US$250) for a baby boy when he was only three days old.</span><br /><span style=\"font-size: 12pt; font-family: \'times new roman\', times, serif;\">Surabaya police, Chief Sr. Comr. Rudi Setiawan, said recently that the transaction was conducted in Semarang, Central Java, on Sept. 23. The baby\'s parents live in Tangerang in Banten. \"<u>The baby is now safe with the Surabaya administration</u>.\" Rudi said on Monday (The Jakarta Post, The October 16, 2018)</span></h1>\r\n<h1><span style=\"font-size: 12pt; font-family: \'times new roman\', times, serif;\"><strong>The reported speech of the underlined sentence is &hellip;.</strong></span></h1>\r\n<p>&nbsp;</p>','1','<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Rudi said the baby is now with the Surabaya administration</span></h1>\r\n<p>&nbsp;</p>','<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Rudi said the baby was now with the Surabaya administration</span></h1>\r\n<p>&nbsp;</p>','<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Rudi said that the baby was then safe with the Surabaya administration</span></h1>\r\n<p>&nbsp;</p>','<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Rudi said if the baby was now safe with the Surabaya administration</span></h1>\r\n<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Rudi said the baby had been now safe with the Surabaya administration</span></h1>\r\n<p>&nbsp;</p>','<h1><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-seri