INSERT INTO `soal` VALUES ('618','36','8','<h1><span style=\"font-family: \'times new roman\', times, serif; font-size: 12pt;\">The Surabaya Police have arrested a man, identified only as MN, for allegedly buying an infant via Instagram. MN was arrested at his house on Jl. Karah in Jambangan district in Surabaya, East Java, on Sunday. He was found to have paid some Rp 3.8 million (US$250) for a baby boy when he was only three days old.</span><br /><span style=\"font-family: \'times new roman\', times, serif; font-size: 12pt;\">Surabaya police, Chief Sr. Comr. Rudi Setiawan, said recently that the transaction was conducted in Semarang, Central Java, on Sept. 23. The baby\'s parents live in Tangerang in Banten. \"<u>The baby is now safe with the Surabaya administration</u>.\" Rudi said on Monday (The Jakarta Post, The October 16, 2018)</span></h1>\r\n<h1><span style=\"font-family: \'times new roman\', times, serif; font-size: 12pt;\">Izam : &nbsp;&nbsp;&nbsp;&nbsp; Naura, I will give you and Qoshi a surprise tonight.</span></h1>\r\n<p>Naura&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; Ok, with pleasure. We will appreciate it.</p>\r\n<p>Qoshi&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; Naura, what did he say?</p>\r\n<p>Naura&nbsp;&nbsp;&nbsp;&nbsp; : &nbsp;&nbsp;&nbsp;&nbsp; ___.</p>','1','<p>He will give you a surprise then</p>\r\n<p>&nbsp;</p>','<p>We will be given a surprise by him</p>\r\n<p>&nbsp;</p>','<p>He is giving you a surprise</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>We will be given a surprise by him</p>\r\n<p>He is giving you a surprise</p>','<p>He is giving you a surprise</p>','B','','','','','','','');
