INSERT INTO `soal` VALUES ('638','37','30','<p>Two students were discussing the school\'s new rule that all the students must wear a cap and a tie One of them showed her annoyance. She said that wearing a cap and a tie was only suitable for a flag rising ceremony. So, she was against the rule. Contrary to the girl\'s opinion, the other student was glad with it. He said that he didn\'t mind with the new rule because wearing a cap and a tie will make the students look great and like real educated persons. The first student gave the reasons that they would feel uncomfortable and hot. Moreover, the classrooms were not air conditioned. The second said it wasn\'t a big problem. He was sure that the students would wear them proudly. They would surely be used to it any way.</p>\r\n<p>&nbsp;<strong>The two students are discussing ...</strong></p>\r\n<p>A. the facilities in school<br />B. their homework<br />C. their uniform<br />D. their friends<br />E. their family</p>\r\n<p>Jawaban : C</p>\r\n<p><br /><br /><br /></p>','1','<p>their friends</p>','<p>their family</p>','<p>the facilities in school</p>','<p>their uniform</p>','','D','','','','','','','');
